import React, {useState } from 'react';
import {ResumeContainer, ResumeWrapper, ResumeContact, newLine} from './resumeElements';
import Navbar from "../../components/nav/navbar";
import Dropdown from '../../components/dropdown/dropdown';
import Footer from '../../components/footer/index';

const Resume = () => {
    const [isOpen, setIsOpen] = useState(false);

    const toggle = () => {
    setIsOpen(!isOpen);
  }
    return (

            <ResumeContainer>
                <Dropdown isOpen={isOpen} toggle={toggle} />
                <Navbar toggle={ toggle } />
                <ResumeWrapper>
                    <ResumeContact> 
                        <text>
                            <h2> Emma Robyn Barua  </h2> 
                            <h6> Makeup Artist Trainee  </h6>
                            <h6> ScreenSkills Film Trainee 2020-21</h6>
                            <h6> Brighton and London based, willing to travel </h6>
                            <h6> M: (+44) 07449 203 870 &nbsp;&nbsp;&nbsp;&nbsp; E: emma@thegalaxygirl.co.uk </h6>
                        </text>
                    </ResumeContact>
                </ResumeWrapper>

                <Footer/>
            </ResumeContainer>

    )
}

export default Resume
